--
-- Name: vg_dgpc_arqueologia; Type: VIEW; Schema: evoradata; Owner: evoradata
--

CREATE VIEW evoradata.vg_dgpc_arqueologia AS
 SELECT dgpc_arqueologia.id,
    dgpc_arqueologia.url,
    dgpc_arqueologia.periodos,
    concat_ws(', '::text, dgpc_arqueologia.tipo_principal, NULLIF(btrim((dgpc_arqueologia.outros_tipos)::text), ''::text)) AS tipo,
    dgpc_arqueologia.designacao,
    dgpc_arqueologia.geom
   FROM evoradata.dgpc_arqueologia;


ALTER TABLE evoradata.vg_dgpc_arqueologia OWNER TO evoradata;

--
-- Name: vw_active_user_sessions; Type: VIEW; Schema: evoradata; Owner: evoradata
--

CREATE VIEW evoradata.vw_active_user_sessions AS
 SELECT user_sessions.login,
    user_sessions.session_id,
    users.can_edit
   FROM (evoradata.user_sessions
     JOIN evoradata.users USING (login))
  WHERE (user_sessions.ts > (now() - '10:00:00'::interval));


ALTER TABLE evoradata.vw_active_user_sessions OWNER TO evoradata;

